import React from "react";

function List(){
    return(
        <ol>
            <li>Jiya</li>
            <li>Pragya</li>
            <li>Sourabh</li>
            <li>Chhavi</li>
            <li>Deshna</li>
        </ol>

    );
}
export default List;
